    false,nt"url": null,nt"notes": "Gulf of Mexico Shrimp Landings -  This
    data set contains catch (landed catch) and effort for fishing trips made by the
    larger vessels that fish near and offshore for the various species of shrimp in
    the Gulf of Mexico. The data collection procedures for the catch/effort data for
    the large vessels consist of two parts. The landings statistics (i.e., quantity,
    value, etc.) are collected from the seafood dealers after the trips are unloaded
    whereas, the data on fishing effort (gear, fishing duration) and area are collected
    by interviews with the captain or crew while the trip is being unloaded.",nt"license_title":
